export const createReservation = (ReservationForm)=>{
    return {
 
        "reservations": [
            {
                "id": ReservationForm.id,
                "user": {
                    "name": ReservationForm.name
                },
                "number_people": ReservationForm.number_people,
                "date": {
                    "name": ReservationForm.name
                },
                "hour": {
                    "name": ReservationForm.name
                }
            }
        ]

        }

    }
